sys_script_include.script:
var GRCImportEntityPersistence = Class.create();
GRCImportEntityPersistence.prototype = {
    initialize: function() {
    },

	insertIntoEntityTable: function(data){
		var importEntity = new GlideRecord("x_anbib_grc_import_entity");
		importEntity.initialize();
		for(var field in data){
			importEntity["u_"+field] = data[field];
		}
		var entityID = importEntity.insert();

		return entityID;
	},

    type: 'GRCImportEntityPersistence'
};
